import React from 'react';

const ShowTodoList = ({ todos }) => {
  console.log("Tareas en ShowTodoList:", todos); // Verifica si llegan las tareas

  return (
    <div>
      <h2>Lista de Tareas</h2>
      <ul>
        {todos.length > 0 ? (
          todos.map((todo) => (
            <li key={todo._id}>
              <h3>{todo.title}</h3>
              <p>{todo.description}</p>
              <p>Prioridad: {todo.priority}</p>
              <p>Fecha: {new Date(todo.date).toLocaleDateString()}</p>
            </li>
          ))
        ) : (
          <p>No hay tareas disponibles</p>
        )}
      </ul>
    </div>
  );
};

export default ShowTodoList;
